import React from "react";
import {withRouter} from "react-router-dom";
import {connect} from "react-redux";


export class Profil extends React.Component
{
    constructor(props) {
        super(props);
    }


    render()
    {
        const { users } = this.props;

        return (
            <div class="text-center">
                <table className="style">
                    <thead class="col row">
                        <div class="row">
                                <div class="col">prenom</div>
                                <div class="col">nom</div>
                                <div class="col">date naissance</div>
                                <div class="col">bio</div>
                                <div class="col">city</div>
                                <div class="col">favoris</div>
                        </div>
                    </thead>
                    <tbody>
                    {users.map((user , index) => {
                        return (
                            <tr class="row" key={index}>
                                <td class="col">{user.firstName}</td>
                                <td class="col">{user.lastName}</td>
                                <td class="col">{user.birthDate}</td>
                                <td class="col">{user.bio}</td>
                                <td class="col">{user.city}</td>

                            </tr>
                        );
                    })}
                    </tbody>
                </table>
            </div>
        )
    }
}


const mapStateToProps = state => {
    return {
        users : state.users
    };
};

export default withRouter(connect(
    mapStateToProps
)(Profil));
